<script setup>
import { ref, computed, onUnmounted } from 'vue';
import DepSbp from './dep-sbp.vue';
import { useDeposit } from '@/composables/deposit';

// Получаем функции для работы с депозитами
const { createDepositRequest, subscribeToStatusUpdates, isLoading, error } = useDeposit();

const amount = ref('');

// Вычисление бонуса 10%
const bonusAmount = computed(() => {
  const numericAmount = parseInt(amount.value) || 0;
  return Math.floor(numericAmount * 0.1);
});

// Итоговая сумма с бонусом
const totalAmount = computed(() => {
  const numericAmount = parseInt(amount.value) || 0;
  return numericAmount + bonusAmount.value;
});
const isModalOpen = ref(false);
const selectedPaymentMethod = ref('СБП');
const showDepSbp = ref(false); // Переключение контента

// Методы оплаты
const paymentMethods = ref([
  { id: 'sbp1', name: 'СБП', icon: 'sbp' },
  { id: 'sbp2', name: 'СБП', icon: 'sbp' },
  { id: 'card', name: 'Карта', icon: 'card' }
]);

const setAmount = (value) => {
  amount.value = value.toString();
};

// Обработка ввода только цифр
const handleInput = (event) => {
  // Удаляем все нецифровые символы
  const numericValue = event.target.value.replace(/[^0-9]/g, '');
  amount.value = numericValue;
};

// Предотвращение ввода нецифровых символов
const preventNonNumeric = (event) => {
  const charCode = event.which || event.keyCode;
  // Разрешаем только цифры (0-9)
  if (charCode < 48 || charCode > 57) {
    event.preventDefault();
  }
};

// Переменные для отслеживания запроса
let statusUnsubscribe = null;

// Управление модальным окном
const openModal = async () => {
  try {
    console.log('Opening modal...');
    
    // Получаем сумму
    const depositAmount = parseInt(amount.value);
    
        if (!depositAmount || depositAmount < 100) {
          console.warn('⚠️ Минимальная сумма пополнения 100₽');
          // TODO: можно добавить уведомление через систему notifications
          return;
        }
    
    console.log('Создание запроса на пополнение...', {
      amount: depositAmount,
      paymentMethod: selectedPaymentMethod.value
    });
    
    // Создаем запрос на пополнение
    // ВРЕМЕННО используем фиктивный telegram_id, в реальном проекте получайте из Telegram WebApp
    const telegramId = 851069605; // TODO: Получить из Telegram.WebApp.initDataUnsafe.user.id
    
    const result = await createDepositRequest(
      telegramId,
      depositAmount,
      selectedPaymentMethod.value || 'СБП'
    );
    
    if (result.success) {
      console.log('✅ Запрос создан успешно:', result);
      
      // Переключаем на dep-sbp контент
      showDepSbp.value = true;
      
            // Подписываемся на обновления статуса
            statusUnsubscribe = subscribeToStatusUpdates(
              result.data.request_id,
              (status) => {
                console.log('Обновление статуса пополнения:', status);
                // Уведомления теперь создаются автоматически через persistent систему
              }
            );
            
            console.log(`🚀 Запрос на пополнение создан! К зачислению: ${result.data.total_amount}₽`);
    }
  } catch (err) {
    console.error('❌ Ошибка создания запроса:', err);
    // TODO: можно добавить уведомление об ошибке через систему notifications
  }
};

const closeModal = () => {
  isModalOpen.value = false;
};

// Выбор метода оплаты
const selectPaymentMethod = (method) => {
  selectedPaymentMethod.value = method.name;
  closeModal();
};

// Очистка подписки при размонтировании
onUnmounted(() => {
  if (statusUnsubscribe) {
    statusUnsubscribe();
    console.log('🧹 Подписка на статус пополнения отменена');
  }
});
</script>
  
